<?php
/**
 * 題庫匯入腳本
 * 生成時間: 2026-02-21 15:08 CST
 * 
 * 使用方式: import_questions.php?key=import2026
 * 
 * 資料表:
 * - questions_renewal_simple: 120 題 (屆期換證-簡易版)
 * - questions_renewal_normal: 323 題 (屆期換證-一般版)
 * - questions_normal: 379 題 (一般操作證)
 * - questions_professional: 579 題 (專業操作證)
 * 
 * 總題數: 1401 題
 */

// 安全驗證
if (!isset($_GET['key']) || $_GET['key'] !== 'import2026') {
    http_response_code(403);
    die(json_encode(['success' => false, 'error' => 'Unauthorized access']));
}

// 載入資料庫連線
require_once 'config.php';

try {
    $pdo = getDBConnection();
    $pdo->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);
} catch (Exception $e) {
    die(json_encode(['success' => false, 'error' => 'Database connection failed: ' . $e->getMessage()]));
}

// Base64 編碼的題庫資料
$data_b64 = [
    'questions_renewal_simple' => '',
    'questions_renewal_normal' => '',
    'questions_normal' => '',
    'questions_professional' => '',
];

// 資料表結構定義
$table_schema = "
CREATE TABLE IF NOT EXISTS `{TABLE}` (
  `id` INT AUTO_INCREMENT PRIMARY KEY,
  `question_number` INT NOT NULL,
  `question_text` TEXT NOT NULL,
  `option_a` TEXT NOT NULL,
  `option_b` TEXT NOT NULL,
  `option_c` TEXT NOT NULL,
  `option_d` TEXT NOT NULL,
  `correct_answer` VARCHAR(1) NOT NULL,
  KEY `idx_question_number` (`question_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
";

$results = [];
$total_inserted = 0;
$start_time = microtime(true);

// 逐個資料表處理
foreach ($data_b64 as $table_name => $encoded_json) {
    try {
        // 解碼資料
        $json_data = base64_decode($encoded_json);
        $questions = json_decode($json_data, true);

        if (!is_array($questions)) {
            throw new Exception("Invalid JSON data for $table_name");
        }

        // 開始交易
        $pdo->beginTransaction();

        // 建立資料表
        $create_sql = str_replace('{{TABLE}}', $table_name, $table_schema);
        $pdo->exec($create_sql);

        // 清空資料表
        $pdo->exec("TRUNCATE TABLE `$table_name`");

        // 準備 INSERT 語句
        $insert_sql = "INSERT INTO `$table_name` 
            (question_number, question_text, option_a, option_b, option_c, option_d, correct_answer) 
            VALUES (:question_number, :question_text, :option_a, :option_b, :option_c, :option_d, :correct_answer)";
        $stmt = $pdo->prepare($insert_sql);

        // 批次插入
        $inserted = 0;

        foreach ($questions as $q) {
            // 從原始格式轉換
            // 原始格式: {"no": 1, "question": "...", "options": {"A": "...", "B": "...", "C": "...", "D": "..."}, "answer": "A"}
            $question_number = $q['no'];
            $question_text = $q['question'];
            $options = $q['options'];
            $correct_answer = $q['answer'];

            $stmt->execute([
                ':question_number' => $question_number,
                ':question_text' => $question_text,
                ':option_a' => $options['A'] ?? '',
                ':option_b' => $options['B'] ?? '',
                ':option_c' => $options['C'] ?? '',
                ':option_d' => $options['D'] ?? '',
                ':correct_answer' => $correct_answer
            ]);
            $inserted++;
        }

        // 提交交易
        $pdo->commit();

        $results[$table_name] = [
            'success' => true,
            'inserted' => $inserted,
            'batches' => ceil($inserted / 100)
        ];
        $total_inserted += $inserted;

    } catch (Exception $e) {
        // 回滾交易
        if ($pdo->inTransaction()) {
            $pdo->rollBack();
        }

        $results[$table_name] = [
            'success' => false,
            'error' => $e->getMessage()
        ];
    }
}

$execution_time = round(microtime(true) - $start_time, 2);

// 回傳結果
header('Content-Type: application/json; charset=utf-8');
echo json_encode([
    'success' => true,
    'total_inserted' => $total_inserted,
    'execution_time' => $execution_time . 's',
    'tables' => $results,
    'timestamp' => date('Y-m-d H:i:s')
], JSON_PRETTY_PRINT | JSON_UNESCAPED_UNICODE);
?>